    ("forward_or_mark_module_start_frame_WARMELTmiMODES marking in frame %p",
     (void *) meltframptr_);
  for (meltix = 0; meltix < 647; meltix++)
    if (meltframptr_->mcfr_varptr[meltix])
      gt_ggc_mx_melt_un (meltframptr_->mcfr_varptr[meltix]);

